@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'frontend';
}
<app-newshore></app-newshore>

<button class="btn btn-danger">Prueba Boostrap</button>
